import VueRouter from 'vue-router';
import login from '../components/login/Login';
import indexEmployee from '../components/employee/indexEmployee';
import register from '../components/login/Register';
import personalCenter from '../components/login/personalCenter';
import index from '../components/Index';
import mainEmployee from '../components/employee/mainEmployee';
import indexMain from '../components/indexMain';

const routes = [
    {
        path:'/',
        name:'login',
        component:login
    },
    {
        path:'/index',
        name:'index',
        component:index,
        children:[
            {
                path:'/indexMain',
                name:'indexMain',
                meta:{
                    title:"首页"
                },
                component:indexMain
            },
            {
                path: '/personalCenter',
                name: 'personalCenter',
                meta:{
                    title:"个人中心"
                },
                component: personalCenter
            },
            {
                path:'/mainEmployee',
                name:'mainEmployee',
                meta:{
                    title:"人员信息"
                },
                component:mainEmployee
            },

        ]
    },
    {
        path:'/indexEmployee',
        name:'indexEmployee',
        component:indexEmployee
    },
    {
        path:'/register',
        name:'register',
        component:register
    },
];

const router = new VueRouter({
    mode:'history',
    routes
});


export default router;
